import React, { Component } from 'react';

/* Images */
import weImg1 from '../assets/img1.jpg';
import weImg2 from '../assets/img2.jpg';
import weImg3 from '../assets/img3.jpg';
import weImg4 from '../assets/img4.jpg';

class SiteBody extends Component{
   constructor(props) {
    super(props);

    this.state = {}
   }

   render(){
      return(
         <div className="site-body">
            <div className="section-container">
                <h1>We Are</h1>
                <div className="text-grid">

                    <div className="item">
                        <div className="item-icon"><i class="fas fa-user-tie"></i></div>
                        <div className="item-text">
                            <p>Experienced leaders with more than 27 years managing and implementing
                                transformative objectives across the various governmental agencies.</p>
                            <p>We have a in-depth understanding of business process, staffing and operational re-
                                engineering, financial management and financial operations, and leveraging state
                                of the art technology to ensure success.</p>
                        </div>
                    </div>

                    <div className="item">
                        <div className="item-icon"><i class="fas fa-sitemap"></i></div>
                        <div className="item-text">
                            <p>Experts in Team Building and Business Partnerships, Staff Augmentation, IT
                            Staffing Solutions, Facilities Management, Office Support Services,
                            Recruitment/Staffing, Document/Data Management, Mail management,
                            Warehouse Services, and Customized Applications that meet our clientâ€™s
                            requirements.</p>
                        </div>
                    </div>

                    <div className="item">
                        <div className="item-icon"><i class="far fa-lightbulb"></i></div>
                        <div className="item-text">
                            <p>Innovative thinkers focused of cost effective solutions that increase business productivity and efficiency.</p>
                            <p>Proud of our reputation for competence and customer satisfaction, and a uniquely qualified candidate for providing client/customer solutions.</p>
                        </div>
                    </div>
                </div>
            </div>
         </div>
      );
   }
}

export default SiteBody;
